import React from 'react';
import styled from 'styled-components';

const Container = styled.div`
	background-color: #444;
	color: #fff;
	width: 100%;
	padding: 1rem;
	display: flex;
	justify-content: center;
	flex-direction: column;
	align-items: center;
	height: 100%;
`;

const StockMarket = () => {
	return (
		<Container>
			<h1>Stock Market</h1>
		</Container>
	);
};

export default StockMarket;
